import React from 'react'
import { useEffect, useState } from 'react';

const TickerAPIData = () => {
    const [price, setPrice] = useState("NA")

    // useEffect(() => {
    //     effect
    //     return () => {
    //         cleanup
    //     }
    // })

    useEffect(() => {
        const getPrice = async () => {
            const res = await fetch("https://finnhub.io/api/v1/quote?symbol=BTC&token=brodjmfrh5r8qo238g3g");
            const data = await res.json();
            console.log(data);
            setPrice(data.c)
        };
        getPrice()
      }); 

    return (
        <div>
            <h4>
                {price}
            </h4>
        </div>
    )
}

export default TickerAPIData
